import styled from 'styled-components/native'
import { FlatList } from 'react-native'


export const Title = styled.Text`
    background-color: #C4170C;
    width: 100%;
    font-weight: bold;
    text-align: center;
    margin-top: 10px;
    padding: 10px;
    font-size: 20px;
    color: #fff;
    line-height: 21px;
`;

export const containerConta = styled.div`
      container: {
        flex: 1,
        marginTop: 15,
    },
    item: {
        backgroundColor: '#f9c2ff',
        padding: 20,
        marginVertical: 8,
        marginHorizontal: 16,
    },
    title: {
        fontSize: 32,
    }

`
